import React from 'react'

const Countries = ({ countries }) => {
    if (countries.length >= 10) {
        return (
            <p>Too many matches, specify another filter</p>
        )
    }
    return (
        <>
            {countries.map((country, index) => {
                    <p key={index}>{country.name}</p>
            })}
        </>
    )
}

export default Countries
